- input: "TEXT\x1CC00403592\x1CX0\x1C\x1CF3XA\x1COn February 10, 2009 I responded
    to your letter dated January 30, 2009 which letter said we had given the Al Franken
    for Senate Recount Fund an excessive contribution by $5,000.  I have learned however
    that the contribution to the recount fund was not in excess but it was misapplied
    because the recount fund was incorrectly named.  The contribution went to the
    Al Franken for U.S. Senate committee.  I have amended this report to reflect the
    correct name of the fund, Franken Recount Fund, and have included their C number.
    \   I hope this clarifies our contribution and that it is acceptable with the
    FEC rules.  Thank you for your cooperation in this matter"
